-- Name: get_missing_blocks_in_range(integer, integer); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.get_missing_blocks_in_range(start_number integer, end_number integer) RETURNS TABLE(block_number integer)
    LANGUAGE plpgsql
    AS $$
BEGIN
  RETURN query
    SELECT series AS block_number
    FROM generate_series(start_number, end_number, 1) series
    LEFT JOIN public.block ON series = block.number
    WHERE block.number IS NULL;
END;
$$;


